import React, { Component } from "react";

class Dashboard extends Component {
  state = {
    loading: true,
    sample_id: null
  };

  componentDidMount() {
    fetch(
      "http://20.191.211.229:5000/v1/datafiles/?filetype=DLERROR&max_size=30",
      {
        method: "GET",
        headers: {
          "Content-Type": "application/json"
        }
      }
    )
      .then(res => {
        return res.json();
      })
      .then(data => {
        this.setState({ sample_id: data.filename, loading: false });
      });
  }

  render() {
    return (
      <div>
        {this.state.loading || !this.state.sample_id ? (
          <h1>Loading...</h1>
        ) : (
          <h1>{this.state.sample_id}</h1>
        )}
      </div>
    );
  }
}

export default Dashboard;
